    #[test]
    fn test_decodes_and_encodes_example_torrent() {
        let path = PathBuf::from("example.torrent");
        let torrent = fs::read(&path).unwrap();

        let value = decode_file(path);

        let encoded = encode(&value);
        let bytes = encoded.into_bytes();
        let mut iter = bytes.iter().peekable();
        let decoded_encoded = decode(&mut iter);

        assert_eq!(torrent.len(), bytes.len());
        assert_eq!(value, decoded_encoded);
    }
